import React, { useState } from "react";
import GoogleLogin from "react-google-login";
import styles from "../Pages/Login.module.css";

import { register } from "../Redux/action";
import { REGISTER_FAILURE, REGISTER_SUCCESS } from "../Redux/actionType";
// import { REGISTER_FAILURE, REGISTER_SUCCESS } from "../Redux/AuthReducer/actionTypes";



function reducer(state, action) {
  // console.log(action)
  // console.log(state)
  switch (action.type) {
    case "name":
      return {
        ...state,
        name: action.payload,
      };
    case "email":
      return {
        ...state,
        email: action.payload,
      };

    case "password":
      return {
        ...state,
        password: action.payload,
      };

    case "phone":
      return {
        ...state,
        phone: action.payload,
      };
    default:
      return state;
  }
}

const initialState = {
  name: "",
  email: "",
  password: "",
  phone:""
};

const SignUp = () => {

  const [showPassword, setShowPassword] = useState(false);
  const [state, setter] = useReducer(reducer, initialState);
  const navigate = useNavigate();
  const dispatch = useDispatch();

  const toast = useToast();

  const handleChange = (e) => {
    let str = e.target.value;
    if (str.includes("@") && str.includes(".")) {
      setShowPassword(true);
    } else {
      setShowPassword(false);
    }

    dispatch(register(state)).then((r) => {
      if (r === REGISTER_SUCCESS) {
          toast({
            title: 'Account created.',
            description: "Your account has been successfully created",
            status: 'success',
            duration: 5000,
            isClosable: true,
          })
        navigate("/sign-in", { replace: true });
      }else if (r === REGISTER_FAILURE) {
        toast({
          description: "Please enter credentials",
          status: 'error',
          duration: 5000,
          isClosable: true,
        })
      }
    });

  };


  const responseGoogle = (res) => {
    // console.log(res);
    let data = { ...res.profileObj, events: {} };
    // console.log(data);
    localStorage.setItem("login", JSON.stringify(data));
  };

  return (
    <div className={styles.login}>
      <div className={styles.nav}>
        <svg
          viewBox="0 0 256 48"
          xmlns="http://www.w3.org/2000/svg"
          className="icon-logo"
          width="110"
          height="24"
        >
          <title>Booking.com</title>
          <g fill="none">
